  [],\n\t\"num_tags\": 0,\n\t\"name\": \"current-direction-benthic-organisms-wind-wave-spectra-data-from-moored-current-meter-casts-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Current direction, benthic organisms, wind
  wave spectra, and other data were collected using moored current meter casts in
  the Gulf of Mexico from March 25, 1977 to February 1, 1980. Data were submitted
  by Texas A&M University as part of the Brine Disposal project. Data has been been
  processed by NODC to the NODC standard F005- Current Meter Data, F132- Benthic Organisms,
  and F191- Wind Wave Spectra formats. Full format and format code descriptions are
  available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe F005 format
  is used for time series measurements of ocean currents obtained using moored current-measuring
  instruments, principally Aanderaa current meters (manufactured by Aanderaa Instruments
  Inc.). These data represent the Eulerian method of current measurement, i.e., the
  meters are deployed at a fixed mooring point and measure flow past the sensor. Position,
  water depth, and sensor depth are reported for each station. The data record comprises
  values of current direction and speed at specified date and time. Data values may
  be subject to averaging or filtering and are typically reported at 10-15 minute
  time intervals. Other environmental parameters may also be reported. These include:
  water temperature, salinity, conductivity, and transmissivity; wind direction and
  speed; and dominant wave direction, height, and period. A text field is available
  for optional comments.nnThe F132 format contains data from field sampling or surveys
  of bottom dwelling marine organisms. The data provide information on species abundance,
  distribution, and biomass; they may have been collected by point sampling (grab
  or core), by tow (dredge, trawl or net), by photographic surveys, or by other methods.
  Cruise information such as vessel, start and end dates, investigator, and institution/agency;
  station numbers, positions and times; and equipment and methods are reported for
  each survey. Environmental data reported at each sampling site may include meteorological
  and sea surface conditions; surface and bottom temperature, salinity and dissolved
  oxygen; and sediment characteristics. Number of individual organisms and total weight
  of organisms is reported for each species. A text record is available for comments.nnThe
  F191 format is used to report meteorological data and ocean wave spectra data from
  NDBO. The format contains seven data record types to: 1) Identify the buoy for position,
  duration, rate of sampling and heading. 2) Identify the meteorological parameters
  (temperature, pressure, weather, solar radiation, and surface waves). 3) Report
  time series frequency, density and resolution of waves. Each record is 120 characters
  in length, sorted by station and record type. The first nine columns for all records
  are to be used for file type (columns 1-3) and file identifier (column 4-9). The
  file identifier, to be assigned by the originator, is an unique originator id for
  each data submission. After submission, the NODC reassigns to this field an unique
  NODC identifier for internal use.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
